import React from 'react';
import { Link } from 'react-router-dom';
import "./about.css"
import WebAssetIcon from '@material-ui/icons/WebAsset';
import StorageIcon from '@material-ui/icons/Storage';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import ListItemText from '@material-ui/core/ListItemText';
import Avatar from '@material-ui/core/Avatar';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';

const About = () => {
    
    return ( 
        <div className="aboutBackground">
            
            <div className="buttonContainer">
                <Link to="/">
                    <button className="exit">X</button>
                    </Link>
            </div> 

            <div className="aboutMeContainer">
                <div className="titleA">About</div>

                <div className="aboutInfo">
                    <div className="skills">
                        <WebAssetIcon style={{ fontSize: 70 }}/>
                        <div className="skillTitle">Front End</div>
                            <Grid item xs={12} md={6}>
                                <Typography variant="h6" className="test">
                                    Avatar with text
                                </Typography>
                                <div className="test2">
                                    <List >
                                        <ListItem>
                                        <ListItemAvatar>
                                            <Avatar>
                                            <StorageIcon />
                                            </Avatar>
                                        </ListItemAvatar>
                                        <ListItemText
                                            primary="Single-line item"
                                        />
                                        </ListItem>
                                    </List>
                                </div>
                            </Grid>
                        </div>

                    <div className="skills">
                        <StorageIcon style={{ fontSize: 70 }}/>
                        <div className="skillTitle">Back End</div>
                    </div>
                </div>
            </div> 

        </div>
     );
}
 
export default About;
